import React from 'react';
import Header from '../components/header';
import Footer from '../components/footer';
import { Divider, Input, DatePicker, Form, Upload, Select, Option } from 'antd';

const StartACampaign = () => {
    const { RangePicker } = DatePicker;
    const { TextArea } = Input;


    return (
        <div>
            <Header />
            <Divider className='header-divider' />
            <div className='body'>
                <div className='title' id='Title'>Start A Campaign</div>
            </div>
            <Form
                labelCol={{ span: 10 }}
                wrapperCol={{ span: 16 }}
                layout="vertical"
                style={{ maxWidth: 600 }}
                className='regForm'
            >
                <Form.Item label="Campaign Title:" rules={[{ required: true, },]}>
                    <Input />
                </Form.Item>
                <Form.Iten label="Campaign Category:">
                    <Select
                        placeholder="Select a option"
                        onChange={onGenderChange}
                    >
                        <Option value="Healthcare Aid">Healthcare Aid</Option>
                        <Option value="Service Access">Service Access</Option>
                        <Option value="Medical Research">Medical Research</Option>
                        <Option value="Mental Health">Mental Health</Option>
                        <Option value="Tech Innovators">Tech Innovators</Option>
                        <Option value="Digital Creators">Digital Creators</Option>
                        <Option value="Sustainable Ventures">Sustainable Ventures</Option>
                        <Option value="Social Explorers">Social Explorers</Option>
                    </Select>
                </Form.Iten>
            </Form>
            <Footer />
        </div>
    );
};

export default StartACampaign;
